import join from "./pages/join";
import Chat from "./pages/Chat";
function App() {
  return (
    <BrowserRouter>
    <Routes>
    <Route index element={<join/>} />
    <Route path="/chat"  element={<chat />} />

    </Routes>
  </BrowserRouter>
  );
}

export default App;
